import React from 'react';
import {
  BrowserRouter as Router, Route, Switch,
} from 'react-router-dom';
// import Routes from './routes/index';
import Principal from './layouts/Principal';

const App = () => (
  <div>
    <Router>
      <Switch>
        <Route exact path="/">
          <Principal />
        </Route>
      </Switch>
    </Router>
  </div>
);

export default App;
